import React from 'react'
import {IoLogoPinterest} from "react-icons/io";

const _stylesNavLeft = {
    iconContainerLeft:{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
        gap: '10px',
    },
    iconPinterest:{
        width: '35px',
        height: '35px',
        borderRadius: '33px',
        color: 'red',
        cursor: 'pointer',
    },
    iconLeft:{
        color: 'white',
        textDecoration: 'none',
    },
    iconInicio:{
        width: '100%',
        height: '100%',
        backgroundColor: 'black',
        display: 'flex',
        padding:'9px',
        justifyContent: 'center',
        alignItems: 'center',
        borderTopRightRadius:'20px',
        borderBottomRightRadius:'20px',
        borderTopLeftRadius:'20px',
        borderBottomLeftRadius:'20px',
    }
    };
function PinIconNavLeft() {
    return (
        <div style={_stylesNavLeft.iconContainerLeft}>
            <IoLogoPinterest style={_stylesNavLeft.iconPinterest}/>
            <div style={_stylesNavLeft.iconInicio}>
                <a style={_stylesNavLeft.iconLeft} href="#"> <strong>Inicio</strong> </a>
            </div>
        </div>
    )
}

export default PinIconNavLeft;
